import s from './Header.module.css'

function Header(){
    return(
        <header className={s.header}>
        <img src='https://www.logolynx.com/images/logolynx/8a/8aa3d1220c8c9b16bd620fac439b3377.jpeg'></img>
        <p>EXISTENTIALISM - прстыми словами</p>
        <div className={s.item}>
          <a href='#'>Profile</a>
        </div>
        </header>
    )
}


export default Header;
